„Iš tiesų aš gimiau Šiauliuose, bet po trejų metų šeima persikėlė į Vilnių. Būdamas 10-ies sostinėje pradėjau lankyti futbolo treniruotes, kurios vyko tuometinėje „Žalgirio“ futbolo mokykloje. Kuomet 1987 m. tėvai persikėlė į Kauną, patekau Algirdo Gruzdo grupę. Daug dirbau ir individualiai, sparčiai tobulėjau ir sulaukęs 16-os jau žaidžiau su vyrais Kauno „Bangos“ ekipoje. Vis dėlto, po kelių metų grįžau į Vilnių ir apsivilkau „Žalgirio“ aprangą“, – prisiminimais dalinosi A.Skarbalius. Per tris „Žalgirio“ gretose praleistus sezonus A. Skarbalius iškovojo du Lietuvos čempiono titulus ir tris kartus kėlė į viršų Lietuvos futbolo federacijos taurę. Pergalių ir titulų netrūko ir kitose karjeros stotelėse: 1995 m. su Kauno „Inkaru“ jis tapo šalies čempionu ir taurės turnyro nugalėtoju, o žaisdamas Kopenhagos „Brondby“ ekipoje per dešimtmetį iškovojo net penkis čempiono titulus bei tris kartus triumfavo taurės varžybose. Baigęs profesionalaus futbolininko karjerą A. Skarbalius treniravo įvairius Danijos futbolo klubus. taip pat nepamiršo ir Lietuvos futbolo reikalų. Bendradarbiaudamas su Lietuvos futbolo federacija jis rengė specialius kursus šalies vaikų ir jaunimo treneriams, supažindino juos su nauja treniruočių metodika. A. Skarbalius taip pat glaudžiai bendradarbiavo su Kauno „Inkaro“ ir Utenos „Utenio“ klubais. Utenoje jis ne tik konsultavo jaunuosius futbolininkus rengiančius trenerius, bet ir užėmė futbolo akademijos techninio vadovo postą. „Aš tiesiog gyvenu futbolu. Po to, kai šių metų liepą atsisveikinau su „Brondby IF“ klubu, pasinėriau į kitą futbolo veiklą: kartu su kolegomis vedėme seminarus futbolo treneriams, organizavome specialius kursus, tęsėme bendradarbiavimą su „Uteniu“, Lietuvos futbolo federacija, jaunimo treneriais. Tad veiklos tikrai netrūko. Be abejo, dabar teks visas jėgas skirti „Žalgirio“ reikmėms, o jei liks šiek tiek laisvo laiko, savo žiniomis padėsiu ir Utenos futbolo akademijos treneriams“, – teigė A. Skarbalius. Vis dėlto, pasak A. Skarbaliaus, dabar jo didžiausias noras – papildyti trofėjų galeriją su „Žalgirio“ klubu. „Svajojau apie darbą „Žalgiryje“. Nuo mažens norėjau būti treneriu, o Lietuvoje „Žalgiris“ buvo ir yra pajėgiausia šalies komanda. Tad labai tikiuosi, kad dabar galėsiu ir pats prisidėti prie naujų „Žalgirio“ pergalių. Reikia tik džiaugtis, kad „Žalgiris“ yra ambicinga komanda, kiekvienais metais norinti laimėti visus trofėjus. Tad šiuo atžvilgiu mūsų tikslai sutampa. Aišku, ne visada pavyksta įgyvendinti išsikeltus tikslus, bet svarbiausia – turėti ambicijas, norą, ir sugebėti perteikti žaidėjams supratimą, kaip svarbu žaidžiant „Žalgiryje“ siekti pačių aukščiausių tikslų“, – kalbėjo po 23 metų pertraukos į legendinį Lietuvos futbolo klubą sugrįžęs futbolo specialistas. Ketverius metus pergales įvairiose Lietuvos futbolo varžybose skynęs „Žalgiris“ naują sezoną pradės be įprastinių titulų. Lietuvos čempionų taurę iš žalgiriečių perėmė Marijampolės „Sūduva“, o LFF taurę – Kauno „Stumbras“. Šios komandos kitų metų pradžioje tarpusavyje išsiaiškins ir naują Supertaurės savininką. (function(d, s, i, r) {
