		})(document, 'script', 'facebook-jssdk', 'fb-root'); „Visi suprantame, kad šis sezonas „Žalgiriui“ buvo nesėkmingas. Tačiau esminis klausimas – kaip greitai klubas atsitiesia po nesėkmės. Geresni ar blogesni periodai būna visiems futbolo klubams. Turiu pasakyti, kad aš netgi džiaugiuosi tokia sezono baigtimi, nes ji rodo, jog Lietuvos futbole „Žalgiriui“ atsiranda rimti konkurentai. Tuo pat metu patobulėjo ir mažesni klubai, tuo irgi reikia tik džiaugtis. Visa tai neleidžia ir „Žalgiriui“ užmigti ant laurų, stumia jį į priekį ir verčia tobulėti“, – konstatavo A. Skarbalius. Nors į pirmą treniruotę žalgiriečiai susirinks tik sausio 8 dieną, tačiau pasak A. Skarbaliaus, nematomas darbas jau vyksta – nagrinėjama komandos sudėtis, derinami pasirengimo sezonui planai. Kalbėdamas apie galimas žaidimo filosofijos permainas, A.Skarbalius sakė, kad reikėtų atrasti aukso vidurį tarp grožio ir rezultato. „Iš principo, mano filosofija – įmušti daugiau įvarčių nei priešininkai. O koks bus būdas? Toks klubas kaip „Žalgiris“ turi propaguoti malonų akiai futbolą, kokį nori matyti mūsų fanai. Kita vertus, bus sunkių rungtynių su pajėgiais varžovais ne tik Lietuvoje, bet ir Europos taurėse, kuomet siekiant rezultato žaidimo grožis nebus svarbiausias faktorius. O šiaip aš esu pragmatikas, noriu laimėti, bet taip pat noriu, kad komanda kiek įmanoma daugiau žaistų su kamuoliu“, – paaiškino A. Skarbalius.
